import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import { Card } from 'react-bootstrap'

function cardStuff() {
   return (


    <Card className='mb-3' style={{ color: "#000" }}>
    
        <Card.Body>
            <Card.Title>
                About
            </Card.Title>          
        </Card.Body>
    </Card>
    

       
    
    );
}
export default cardStuff;
